import styled from "styled-components";

const OutBorder = styled.div`
  border: solid var(--gray);
  height: 650px;
  color: red;
`;

const InnerBorder = styled(OutBorder)`
  border: solid var(--white);
  margin: 10%;
`;

function ReportSection() {
  return <></>;
}

export default ReportSection;
